import React from "react";


// reactstrap components
import {
    CardBody,
    Col
} from "reactstrap";



class Video extends React.Component {
    render() {
        return (
            <>
                <div className="content">
                    <CardBody>
                        <Col className="ml-auto mr-auto" md="6" lg="7">

                        </Col>
                    </CardBody>
                </div>
            </>
        );
    }
}

export default Video;
